import React from 'react';
import './App.css';
import {PATH_SHOP} from "./config/confi_nav";
import Shop from "./components/shop/Shop";
import {Route, Switch} from "react-router-dom";

function App() {
  return <React.Fragment>
    <Switch>
      <Route path={PATH_SHOP} exact render={() => {
        return <Shop />
      }}>
      </Route>
    </Switch>
  </React.Fragment>
}

export default App;
